function TestColors() {

  let sat = "50%";
  let hue = "22%";


  return (
    <div>
      <h2>Testing Colors</h2>
      <div id="background-color" style={{ height: "800px", backgroundColor: `hsl(0, 0%, 0%)` }}>
        <div id="violet" style={{ height: "200px", backgroundColor: `hsl(211, ${sat}, ${hue})` }}>
          <p style={{ color: "#ffffff" }}>Lorem, ipsum dolor sit amet consectetur adipisicing elit.</p>
          <p style={{ color: "#000000" }}>Lorem, ipsum dolor sit amet consectetur adipisicing elit.</p>
        </div>
        <div id="green" style={{ height: "300px", backgroundColor: `hsl(91, ${sat}, ${hue})` }}>
          <p style={{ color: "#ffffff" }}>Lorem, ipsum dolor sit amet consectetur adipisicing elit.</p>
          <p style={{ color: "#000000" }}>Lorem, ipsum dolor sit amet consectetur adipisicing elit.</p>
        </div>
        <div id="orange" style={{ height: "200px", backgroundColor: `hsl(331, ${sat}, ${hue})` }}>
          <p style={{ color: "#ffffff" }}>Lorem, ipsum dolor sit amet consectetur adipisicing elit.</p>
          <p style={{ color: "#000000" }}>Lorem, ipsum dolor sit amet consectetur adipisicing elit.</p>
        </div>
        {/* <div id="orange" style="height: 200px; background-color: hsl(39, 100%, 50%)"></div>  */}
      </div>
    </div >
  );
}

export default TestColors;
